import React, { useState } from "react";
import { View, Text, StyleSheet, Image } from "react-native";

const MainScreen = (props) => {
  const [images, updateImages] = useState([
    {
      img: require("https://static.scientificamerican.com/sciam/cache/file/7A715AD8-449D-4B5A-ABA2C5D92D9B5A21_source.png"),
    },
    {
      img: require("https://www.lovethegarden.com/sites/default/files/content/articles/UK_wildbirds-01-robin.jpg"),
    },
    {
      img: require("https://lafeber.com/pet-birds/wp-content/uploads/2018/06/Cockatiel-2.jpg"),
    },
    {
      img: "https://scx2.b-cdn.net/gfx/news/hires/2019/uscresearche.jpg",
    },
    {
      img:
        "https://www.thespruce.com/thmb/bS1rvJQcPY2BwMoeAOT_l8x__0Q=/960x0/filters:no_upscale():max_bytes(150000):strip_icc()/red-summer-tanager-58991d123df78caebc049ac4.jpg",
    },
    {
      img:
        "https://www.thisiscolossal.com/wp-content/uploads/2019/12/lloyd-7.jpg",
    },
  ]);

  return (
    <View>
      <Text>This is the main Screen</Text>
      {images.map((bird, i) => {
        console.log(bird);
        return <Image key={i} source={bird.url} />;
      })}
    </View>
  );
};

